    public static int subarrayBitwiseORs(int[] arr) {
        if (arr.length == 1) {
            return 1;
        }
        int value = 0;
        for (int i = 0; i < arr.length; i++) {
            value = value | 1 << arr[i];
        }
        String str = Integer.toBinaryString(value);
        System.out.println(str);
        int oneNum = 0;
        for (int i = 0; i < str.length(); i++) {
            if (str.charAt(i) == '1') {
                oneNum++;
            }
        }
        int res = 0;
        for (int i = 0; i < oneNum; i++) {
            res = res | 1 << i;
        }
        return res;
    }


    public static int subarrayBitwiseORs2(int[] arr) {
        Set<Integer> set = new HashSet<>();
        for (int i = 0; i < arr.length; i++) {
            int value = arr[i];
            for (int j = i; j < arr.length; j++) {
                value = value | arr[j];
                set.add(value);
            }
        }
        return set.size();
    }

    private static int getOneCnt(String str) {
        int oneNum = 0;
        for (int i = 0; i < str.length(); i++) {
            if (str.charAt(i) == '1') {
                oneNum++;
            }
        }
        return oneNum;
    }

    public static int subarrayBitwiseORs3(int[] arr) {
        Set<Integer> set = new HashSet<>();
        if (arr.length == 1) {
            return 1;
        }
        int maxOneCnt = 0;
        int value = arr[0];
        set.add(arr[0]);
        int currentOneCnt = getOneCnt(Integer.toBinaryString(value));
        for (int i = 0; i < arr.length; i++) {
            if (set.contains(arr[i])) {
                continue;
            } else {
                set.add(arr[i]);
            }
            if (arr[Math.max(i - 1, 0)] == arr[i]) {
                continue;
            }
            value = value | arr[i];
            int nextOneCnt = getOneCnt(Integer.toBinaryString(value));
            if (nextOneCnt - currentOneCnt > 0) {
                maxOneCnt += 3;
            } else {
                maxOneCnt += 2;
            }
            currentOneCnt = nextOneCnt;
        }
        return maxOneCnt;
    }

    public static int subarrayBitwiseORs4(int[] A) {
        Set<Integer> res = new HashSet<>(), cur = new HashSet<>(), cur2;
        for (Integer i : A) {
            cur2 = new HashSet<>();
            cur2.add(i);
            for (Integer j : cur) {
                cur2.add(i | j);
            }
            cur = cur2;
            System.out.println("cur size:" + cur.size() + " cur:" + cur);
            res.addAll(cur);
        }
        return res.size();
    }


